## List sync operations in a feature view
Use the following sample to view a list of all sync operations executed for a feature view.
To view the list of data sync operations in a [FeatureView](/vertex-ai/docs/reference/rest/v1beta1/projects.locations.featureOnlineStores.featureViews#resource:-featureView) instance, send a `GET` request by using the [featureViewSyncs.list](/vertex-ai/docs/reference/rest/v1beta1/projects.locations.featureOnlineStores.featureViews.featureViewSyncs/list) method.
Before using any of the request data, make the following replacements:- : Region where the online store is located, such as`us-central1`.
- : Your project ID.
- : The name of the online store containing the feature view.
- : The name of the feature view for which you want to view the list of data sync operations.
HTTP method and URL:
```
GET https://LOCATION_ID-aiplatform.googleapis.com/v1beta1/projects/PROJECT_ID/locations/LOCATION_ID/featureOnlineStores/FEATUREONLINESTORE_NAME/featureViews/FEATUREVIEW_NAME/featureViewSyncs
```
To send your request, choose one of these options:
 **Note:** The following command assumes that you have logged in to  the`gcloud`CLI with your user account by running [gcloud init](/sdk/gcloud/reference/init) or [gcloud auth login](/sdk/gcloud/reference/auth/login) ,  or by using [Cloud Shell](/shell/docs) ,  which automatically logs you into the`gcloud`CLI.  You can check the currently active account by running [gcloud auth list](/sdk/gcloud/reference/auth/list) .
Execute the following command:
```
curl -X GET \ -H "Authorization: Bearer $(gcloud auth print-access-token)" \ "https://LOCATION_ID-aiplatform.googleapis.com/v1beta1/projects/PROJECT_ID/locations/LOCATION_ID/featureOnlineStores/FEATUREONLINESTORE_NAME/featureViews/FEATUREVIEW_NAME/featureViewSyncs"
``` **Note:** The following command assumes that you have logged in to  the`gcloud`CLI with your user account by running [gcloud init](/sdk/gcloud/reference/init) or [gcloud auth login](/sdk/gcloud/reference/auth/login) ,  or by using [Cloud Shell](/shell/docs) ,  which automatically logs you into the`gcloud`CLI.  You can check the currently active account by running [gcloud auth list](/sdk/gcloud/reference/auth/list) .
Execute the following command:
```
$cred = gcloud auth print-access-token$headers = @{ "Authorization" = "Bearer $cred" }Invoke-WebRequest ` -Method GET ` -Headers $headers ` -Uri "https://LOCATION_ID-aiplatform.googleapis.com/v1beta1/projects/PROJECT_ID/locations/LOCATION_ID/featureOnlineStores/FEATUREONLINESTORE_NAME/featureViews/FEATUREVIEW_NAME/featureViewSyncs" | Select-Object -Expand Content
```
